import React from 'react';
import './style.css';
import IconButton from '@material-ui/core/IconButton';
import DeleteIcon from '@material-ui/icons/Delete';

class CourseListApp extends React.Component {
  constructor (props){
    super ();
  }
  render (){
    return (
      <div>
        <AppJumbotron title="Course Checklist" />
        <ItemList />
        <br />
        <br />
        <br />
        <CourseCount count={AllCourses.length} />
      </div>
    );
  }
}

class Item extends React.Component {
  constructor (props){
    super ();

    this.state = {
      checked: false,
      deleted: false
    };

    this.handleClick = this.handleClick.bind(this); 
    this.deleteClick = this.deleteClick.bind(this);   
  }
  handleClick (e){
    this.setState({
      checked: !this.state.checked
    });

  }

  deleteClick(e){
    this.setState({ 
      deleted: this.state.deleted=true
    });
  }
  render (){
    let text = this.state.checked ? <strike>{this.props.message}</strike> : this.props.message;
    return (
        <div className="row">
          <div className="col-md-12">
            <input type="checkbox" onClick={this.handleClick} />&nbsp;{text}
            <IconButton aria-label="delete" onClick={this.deleteClick}>
              <DeleteIcon />
            </IconButton>
            <hr />
          </div>
        </div>
    );
  }
}

let item2 = <Item message="CSE 1105 Introduction to CSE" />;
let item3 = <Item message="CSE 1320 Intermediate Programming" />;
let item4 = <Item message="CSE 1325 Object-Oriented Programming" />;

let AllCourses = [item2, item3, item4];

class ItemList extends React.Component {
  constructor (props){
    super ();
  }
  render (){
    let items = AllCourses.map(course=>{
      return(
        course.deleted==false? course : null
      )
    })
    return (
        <h5>{items}</h5>
    );
  }
}

class CourseCount extends React.Component {
  constructor (props){
    super ();
  }
  render (){
    return (
      <h4>There are {this.props.count} courses on your Course Checklist</h4>
    );
  }
}

class AppJumbotron extends React.Component {
  render (){
    return (
      <div className="jumbotron">
        <h2 style={{textAlign: "center",}}>
          {this.props.title}
        </h2>

      </div>
    );
  }
}


export default CourseListApp;
